// App.js or any other React component file
import React from 'react';


function App() {
  return (
   <div>

      <section id="Hobbies" title="Hobbies">
        <ul>
          <li>Meditation</li>
          <li>Gardening</li>
          <li>Reading</li>
          
        </ul>
      </section>
    </div>
  );
}

export default App;
